/// Check if a word requires 'a' as determiner (binary search)
pub fn requires_en_a(word: &str) -> bool {
	let lower = word.to_lowercase();
	EN_DET_A_WORDS.binary_search(&lower.as_str()).is_ok()
}

/// Check if a word requires 'an' as determiner (binary search)
pub fn requires_en_an(word: &str) -> bool {
	let lower = word.to_lowercase();
	EN_DET_AN_WORDS.binary_search(&lower.as_str()).is_ok()
}
